def productExceptSelf(nums):
    result = []
    n = len(nums)
    for i in range(n):
        mul = 1
        for j in range(n):
            if i != j:
                mul *= nums[j]
        result.append(mul)
    
    return result

def product_except_self(nums):
    n = len(nums)
    result = [1] * n

    # Calculate prefix products
    prefix = 1
    for i in range(n):
        result[i] = prefix
        prefix *= nums[i]

    # Calculate suffix products and update result
    suffix = 1
    for i in range(n - 1, -1, -1):
        result[i] *= suffix
        suffix *= nums[i]

    return result




